import React from 'react';
import { Container, BackgroundImage, Overlay, TextContainer, LogoBox, Title } from './HeroComponentStyles';

const Hero = ({ title, backgroundImage, showLogoBox = true, height }) => {
    return (
        <Container height={height}>
            <BackgroundImage src={backgroundImage} alt="background" />
            <Overlay />
            <TextContainer>
                {showLogoBox && (
                    <LogoBox>
                        <Line />
                    </LogoBox>
                )}
                <Title>{title}</Title>
            </TextContainer>
        </Container>
    );
};

export default Hero;
